import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
        <div className='app-wrapper'>
            <header className='header'>
                <img src='https://www.freelogodesign.org/Content/img/logo-samples/flooop.png'/>
            </header>

            <nav className='nav'>
                <div>
                    <a>Profile</a>
                </div>
                <div>
                    <a>Profile</a>
                </div>
                <div>
                    <a>Profile</a>
                </div>
            </nav>
            <div className='content'>
                Main content
            </div>
        </div>
    );
}

export default App;
